// Login.js
import React from 'react';
import Signup from './components/Signup.js'
import './Login.css';
function Login() {
  return (
    <div className='body'>
      <div className="login_top">
        <h1>Login... </h1>
        <form action="/loginsubmit" method="POST">
          <div className="login_form">
            <div className="login_f1">
              <label className='login_label' htmlFor="email">Mail&nbsp;ID </label>
              <input className="login_input" type="email" name="email" />
            </div>
            <div className="login_f1">
              <label className='login_label' htmlFor="password">Password</label>
              <input  className="login_input" type="password" name="password" />
            </div>
            <div>
              <button className="login_btnn">Submit</button>
            </div>
          </div>
        </form>
        <Link to="/signup">SignUp</Link>
      </div>
      <p className="login_logo_body">
        {/* <img src="https://cdn.glitch.global/74966f89-6b4a-4631-ad79-95f11a65e0dd/logo11.jpg?v=1697535569992" alt="" /> */}
      </p>
    </div>
  );
}

export default Login;
